import './Home.css';
import RetuRnLogo from './Logo';
import ReturnButton from './Btn';
import ReturnTitle from './Title';
import ReturnQuOte from './Quote';

// Return Home Compoennt 
export default function ReturnHmDash() {
 return (
  <div className='wrp-home-admin'>
   <img src={'/img/home.jpg'} />
   <div className='wrp-glass-home-admin'></div>

   <div className='wrp-content-home'>
    <h1>Hello</h1>
   </div>

   <RetuRnLogo />
   <ReturnButton />
   <ReturnQuOte />
   <ReturnTitle />

  </div>
 );
};
